import {Link} from 'react-router-dom';

function Navbar() {
    return (
        <>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to="/" className="navbar-logo">
                        LABRATS
                    </Link>
                    <div className='menu-icon'>

                    </div>
                </div>
            </nav>
        </>

    )
}

export default Navbar
